import { NavLink } from 'react-router-dom';


const NavBar = () => {
    return (
        <nav>
            <ul>
                <li>
                    <NavLink to="/Home">Home lol</NavLink>
                </li>
                <li>
                    <NavLink to="/Calculate">Calculate lol</NavLink>
                </li>
                <li>
                    <NavLink to="/Contact">Contact lol</NavLink>
                </li>
            </ul>
        </nav>
    )
}

export default NavBar;
